window.bookSummaryJSON = "<p><b>With delectable characters and non-stop thrills that have made Janet Evanovich a household name, </b><b><i>Wicked Appetite</i></b><b> will leave you hungry for more. </b></p> <p>Life in Marblehead has had a pleasant predictability, until Diesel arrives. Rumor has it that a collection of priceless ancient relics representing the Seven Deadly Sins have made their way to Boston's North Shore. Partnered with pastry chef Lizzie Tucker, Diesel bullies and charms his way through historic Salem to track them down - and his criminal mastermind cousin Gerewulf Grimorie. </p> <p>The black-haired, black-hearted Wulf is on the hunt for the relic representing gluttony. Caught in a race against time, Diesel and Lizzie soon find out that more isn't always better, as they battle Wulf and the first of the deadly sins. </p>"; 
